import styled from 'styled-components';

export const Container = styled.div`
  height: 398px;
  background: #ffffff;
  padding: 50px 0;
  display: flex;
  justify-content: center;
  .contact {
    margin-right: 180px;
    h5 {
      font-weight: 600;
      font-size: 28px;
      line-height: 42px;
      color: #000000;
      margin-bottom: 10px;
    }
    h4 {
      margin-bottom: 30px;
    }
    h4,
    span {
      font-weight: 600;
      font-size: 24px;
      line-height: 36px;
      color: #000000;
    }
    p {
      font-size: 20px;
      color: #000000;
      line-height: 30px;
      margin: 0;
    }
  }
`;

export const Inputs = styled.div`
  display: flex;
  align-items: flex-start;
  flex-direction: column;
  justify-content: center;
  margin-bottom: 35px;
  p {
    font-size: 24px;
    line-height: 36px;
    color: #000000;
    margin: 0;
  }
  input {
    background: #f5f5f7;
    margin: 0.5em;
  }
`;
